import Apple from '../../img/apple.png';
import Samsung from '../../img/samsung.png';
import MTS from '../../img/mts.png';
import b8 from '../../img/b8.png';
import tinkoff from '../../img/tinkoff.png';
import VK from '../../img/vk.png';
import App from '../App';

const CompanyContent = () => {
    return (
        <div className="relative bg-[#EFEFEF] w-full h-screen rounded-tl-[80px] p-[50px]">
            <div className="grid grid-cols-3 gap-[100px] items-center justify-center">
                <div className="bg-white flex flex-col p-[15px] rounded-[15px] justify-center items-center">
                    <img src={b8} alt="" className='w-[100px] h-[100px] rounded-full' style={{position:"relative",
                top: "-60px",
                padding: "5px",
                background: "white"}} />
                    <h3 className='font-medium text-[20px]'>Самый северный акселератор инновационных проектов B8</h3>
                </div>
                <div className="bg-white flex flex-col p-[15px] rounded-[15px] justify-center items-center">
                    <img src={Apple} alt="" className='w-[100px] h-[100px] rounded-full' style={{position:"relative",
                top: "-60px",
                padding: "5px",
                background: "white"}} />
                    <h3 className='font-medium text-[20px]'>AppleInc. - крупнейшая американская корпорация, производящая компьютеры, планшеты, телефоны, плееры и программное обеспечение</h3>
                </div>
                
            </div>
        </div>
    )
}

export default CompanyContent
